import React from 'react'
import ReactDOM from 'react-dom'
import data from "./kuntienavainluvut"; 




const App = () => {


    const valuet = data.dataset.dimension["Alue 2019"].category.label
    const asukasluvut = data.dataset.value

    var taulukko = [];
    var x;

    var numero = 0;

    console.log(asukasluvut[0])
    console.log(valuet[109])


    for (x in valuet) {
        taulukko.push(valuet[x]);
      }
console.log(taulukko[0])

function doFunction() {
  console.log("joo")
}


    return (
      <div>


          <ul>
          {taulukko.map(s => (<li><button type="button" onClick={doFunction()} id={numero++}>{s}</button></li>))}

            </ul>

<div>
<button type="button">Click Me!</button>
</div>

      </div>

    )
  }

ReactDOM.render(
  React.createElement(App, null),
  document.getElementById('root')
)
